import React, { useState } from "react";
import { Navbar, Button, Table, Modal } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import Logo from "../../Images/Logo1.png";
import FileUpload from "./FileUpload";

function Manager() {
  const navigate = useNavigate();
  const [uploadedImageUrl, setUploadedImageUrl] = useState<string | null>(null);
  const [projects, setProjects] = useState<string[]>([]);
  const [showAddProjectModal, setShowAddProjectModal] = useState(false);
  const [showProjectDescriptionModal, setShowProjectDescriptionModal] =
    useState(false);
  const [showAvailableDevelopersModal, setShowAvailableDevelopersModal] =
    useState(false); // New modal state
  const [selectedProject, setSelectedProject] = useState<string | null>(null);
  const [projectDescription, setProjectDescription] = useState<string>("");

  const handleLogout = () => {
    navigate("/");
  };

  const addProject = (projectName: any) => {
    setProjects([...projects, projectName]);
    setShowAddProjectModal(false);
  };

  const openProjectDescriptionModal = (projectName: string) => {
    setSelectedProject(projectName);
    // For demonstration, set a static project description here.
    setProjectDescription("This is a sample project description.");
    setShowProjectDescriptionModal(true);
  };

  const openAvailableDevelopersModal = () => {
    setShowAvailableDevelopersModal(true);
  };

  const closeAvailableDevelopersModal = () => {
    setShowAvailableDevelopersModal(false);
  };

  return (
    <div>
      <Navbar>
        <img src={Logo} alt="Logo" className="logo-1" />
        <Button
          variant="transparent"
          className="logout-btn"
          onClick={handleLogout}
        >
          Logout
        </Button>
      </Navbar>

      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>Services</li>
          <li>Options</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>

      <div className="projects-table">
        <h2>Projects</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th className="d-flex justify-content-between align-items-center">
                Project Name
                <FileUpload onUpload={addProject} />
              </th>
            </tr>
          </thead>
          <tbody>
            {projects.map((projectName, index) => (
              <tr key={index}>
                <td className="d-flex justify-content-between align-items-center">
                  <span
                    className="project-name-link"
                    onClick={() => openProjectDescriptionModal(projectName)}
                  >
                    {projectName}
                  </span>
                  <Button
                    variant="dark"
                    size="sm"
                    className="ml-auto"
                    onClick={openAvailableDevelopersModal} // Open the modal when clicked
                  >
                    Assign
                  </Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
      {/* Add Project Modal */}
      <Modal
        show={showAddProjectModal}
        onHide={() => setShowAddProjectModal(false)}
      >
        <Modal.Header closeButton>
          <Modal.Title>Add Project</Modal.Title>
        </Modal.Header>
        <Modal.Body>{/* Your add project form content goes here */}</Modal.Body>
        <Modal.Footer>
          <Button
            variant="secondary"
            onClick={() => setShowAddProjectModal(false)}
          >
            Close
          </Button>
          <Button variant="dark" onClick={addProject}>
            Submit
          </Button>
        </Modal.Footer>
      </Modal>

      {/* Project Description Modal */}
      <Modal
        show={showProjectDescriptionModal}
        onHide={() => setShowProjectDescriptionModal(false)}
      >
        <Modal.Header closeButton>
          <Modal.Title>Project Description</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>{projectDescription}</p>
        </Modal.Body>
        <Modal.Footer>
          <Button
            variant="secondary"
            onClick={() => setShowProjectDescriptionModal(false)}
          >
            Close
          </Button>
          <Button variant="secondary">Delete</Button>
          <Button variant="dark">Edit</Button>
        </Modal.Footer>
      </Modal>

      {/* Available Developers Modal */}
      <Modal
        show={showAvailableDevelopersModal}
        onHide={closeAvailableDevelopersModal}
      >
        <Modal.Header closeButton>
          <Modal.Title>Available Developers</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {/* Add content for Available Developers here */}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={closeAvailableDevelopersModal}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Manager;
